import styled from "styled-components";
import {
  typography,
  layout,
  position,
  variant,
  space,
  color,
  background,
} from "styled-system";

export const Text = styled.p`
  ${typography}
  ${layout}
  ${position}
  ${variant}
  ${space}
  ${color}
  ${background}
`;
